import React from 'react';
import './Item.css'
export default class Item extends React.Component {
    constructor(props) {
      super(props);
    }
    render() {
      return <div id="item">
          <img id="image" src={this.props.image}></img>
          <h2 id="title">France soldier</h2>
        </div>
    }
  }
